import styled from "styled-components";

const IconWrapper = styled.div`
  display: flex;
  align-items: center;
  min-width: 15em;
  max-width: 40em;
  padding: 0.5em;
  margin-top: 0.2em;
  border: 1px solid #dcdde1;
  border-radius: 4px;
`;

export default IconWrapper;
